WITH
	T AS (
		SELECT
			ID,
			NAME,
			ISO3,
			ISO2,
			PHONECODE,
			CAPITAL,
			CURRENCY,
			CURRENCY_SYMBOL,
			TLD,
			NATIVE,
			REGION,
			SUBREGION,
			TRANSLATIONS,
			LATITUDE,
			LONGITUDE,
			EMOJI,
			EMOJIU,
			CREATED_AT,
			UPDATED_AT,
			FLAG,
			WIKIDATAID,
			TIMEZONES,
			MD5(
				CONCAT(
					ID::TEXT,
					NAME::TEXT,
					ISO3::TEXT,
					ISO2::TEXT,
					PHONECODE::TEXT,
					CAPITAL::TEXT,
					CURRENCY::TEXT,
					CURRENCY_SYMBOL::TEXT,
					TLD::TEXT,
					NATIVE::TEXT,
					REGION::TEXT,
					SUBREGION::TEXT,
					TRANSLATIONS::TEXT,
					LATITUDE::TEXT,
					LONGITUDE::TEXT,
					EMOJI::TEXT,
					EMOJIU::TEXT,
					CREATED_AT::TEXT,
					UPDATED_AT::TEXT,
					FLAG::TEXT,
					WIKIDATAID::TEXT,
					TIMEZONES::TEXT
				)
			) AS HASHED
		FROM
			LOADING_COUNTRIES C
	)
INSERT INTO
	PUBLIC.COUNTRIES AS C (
		ID,
		NAME,
		ISO3,
		ISO2,
		PHONECODE,
		CAPITAL,
		CURRENCY,
		CURRENCY_SYMBOL,
		TLD,
		NATIVE,
		REGION,
		SUBREGION,
		TRANSLATIONS,
		LATITUDE,
		LONGITUDE,
		EMOJI,
		EMOJIU,
		CREATED_AT,
		UPDATED_AT,
		FLAG,
		WIKIDATAID,
		TIMEZONES,
		HASHED
	)
SELECT
	ID,
	NAME,
	ISO3,
	ISO2,
	PHONECODE,
	CAPITAL,
	CURRENCY,
	CURRENCY_SYMBOL,
	TLD,
	NATIVE,
	REGION,
	SUBREGION,
	TRANSLATIONS,
	LATITUDE,
	LONGITUDE,
	EMOJI,
	EMOJIU,
	CREATED_AT,
	UPDATED_AT,
	FLAG,
	WIKIDATAID,
	TIMEZONES,
	HASHED
FROM
	T
ON CONFLICT (ID) DO
UPDATE
SET
	NAME = EXCLUDED.NAME,
	ISO3 = EXCLUDED.ISO3,
	ISO2 = EXCLUDED.ISO2,
	PHONECODE = EXCLUDED.PHONECODE,
	CAPITAL = EXCLUDED.CAPITAL,
	CURRENCY = EXCLUDED.CURRENCY,
	CURRENCY_SYMBOL = EXCLUDED.CURRENCY_SYMBOL,
	TLD = EXCLUDED.TLD,
	NATIVE = EXCLUDED.NATIVE,
	REGION = EXCLUDED.REGION,
	SUBREGION = EXCLUDED.SUBREGION,
	TRANSLATIONS = EXCLUDED.TRANSLATIONS,
	LATITUDE = EXCLUDED.LATITUDE,
	LONGITUDE = EXCLUDED.LONGITUDE,
	EMOJI = EXCLUDED.EMOJI,
	EMOJIU = EXCLUDED.EMOJIU,
	CREATED_AT = EXCLUDED.CREATED_AT,
	UPDATED_AT = EXCLUDED.UPDATED_AT,
	FLAG = EXCLUDED.FLAG,
	WIKIDATAID = EXCLUDED.WIKIDATAID,
	TIMEZONES = EXCLUDED.TIMEZONES,
	HASHED = EXCLUDED.HASHED
WHERE
	C.HASHED != EXCLUDED.HASHED;

DELETE FROM COUNTRIES CT
WHERE id
	NOT IN (
		SELECT
			id
		FROM
			LOADING_COUNTRIES
	);

DROP TABLE IF EXISTS LOADING_COUNTRIES;
